    max-width: 1080px;
    margin: 0 auto;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;

    p {
        font-size: 4rem;
        font-weight: 900;
    }
`

const Title = styled.h1`
    font-size: 2rem;
    font-weight: 900;
    text-align: center;
`

const SubTitle = styled.h2`
    font-size: 2rem;
    font-weight: 900;
    text-align: center;
    margin-top: 1.5rem;
`

function MainSecTitleCTA(){
    return (
        <Div>
            <Title>CON NUESTRO PLAN AMIGO QUERRÁS INVITATAR TODA TU AGENDA.</Title>
            <SubTitle>CONSIGUE</SubTitle>
            <p>15€</p>
            <Title>EM DESCONTOS, PARA CADA AMIGO QUE VOCÊ TRAZ.</Title>
            <Title>SUSCRIBE NUESTROS PAQUETES</Title>
            <Button>INSCRIBIRSE</Button>
        </Div>
    )
}

export default MainSecTitleCTA
